import React from 'react';
import './App.scss';
import { Logo, Numbers, ScrollButton, Title } from './components';

const App: React.FC<unknown> = () => {
  return (
    <div className="">
      <Logo />
      <Numbers />
      <Title />
      <ScrollButton />
    </div>
  );
};

export default App;
